import React from 'react';
import Header from '../layout/Header';
import Footer from '../layout/Footer';

//component
//component + props
//component + props 생략
//component + props + 객체
//component + props + 반복문

function Info({text1,text2,text3,text4}) {
    return(
    <div className="main__cont">
        <div>{text1}</div>
        <div>{text2}</div>
        <div>{text3}</div>
        <div>{text4}</div>
    </div>
    );
}

const textInfo = [
    {text1 : "WE PROVIDE"},
    {text2 : "VISUAL CODING"},
    {text3 : "SOLUTIONS"},
    {text4 : "FOR YOU WEBS"}
]

function Main() {
    return (
      <div id="wrap">
        <Header/>
        <section id="mainCont">
           <Info 
            text1 = {textInfo.text1}
            text2 = {textInfo.text2}
            text3 = {textInfo.text3}
            text4 = {textInfo.text4}
           />
        </section>
        <Footer/>
      </div>
    );
  }

export default Main;
